    useEffect(() => {
       let myMovie = {
            id:1,
            title : "Highlender",
            release_date: "1986-03-06",
            runtime: 166,
            mpaa_rating: "R",
            description: "SOmething here",
        } 
        setMovie(myMovie)
    }, [id])
    return (
            <div>
                <h2>Movie: {movie.title}</h2>
                <hr />
                <p></p>
            </div>
    )
}

export default Movie;
